import styled from "styled-components";

export const Input = styled.input`
  width: 50%;

  background: none;
  border: none;
  outline: none;
  border-bottom: 1px solid #fff;

  margin-bottom: 24px;
`;

export const Label = styled.label``;

export const Error = styled.span``;
